window.bookSummaryJSON = "<p><b>Victory unveils a greater threat. Alliances forge victims into allies. Responsibility in spades.</b></p> <p>As the people of Wildwood start to pick up the pieces of their shattered society, eyes have started to turn beyond their territory. With the help of the only squad bold enough to brave the wilds for the sake of the smaller towns, Ronan and his friends set out once more to explore new territory.</p> <p>Plying his rough form of diplomacy, Ronan is able to bring the keys to power further than his Metier Crystal allies ever expected. Strategy, battles, and crafting have impacted the lives of every survivor. He quickly realizes that the scope of his efforts has expanded beyond what he could handle, but his very nature prevents him from yielding to the pressure.</p> <p>As the threats multiply, it remains to be seen if Ronan will crumble...or be reforged to bear the burden of leadership.</p>"; 
